import { stripTrailing } from "src/runtime/index";
/**
 * **getTokenData**`(token)`
 *
 * Given a `Shape` token, this function will extract the
 * data parameters from the token.
 */
export const getTokenData = (token) => {
    const [_name, ...rest] = stripTrailing(token, ">>").split("::");
    return rest;
};
